import{_ as t,p as e,q as o,a1 as a}from"./framework-5866ffd3.js";const r={},s=a('<h1 id="前言" tabindex="-1"><a class="header-anchor" href="#前言" aria-hidden="true">#</a> 前言</h1><p>API 现已开放测试啦！ 欢迎各位大佬前来调试与二次开发捏！注意，由于加密格式的变更，需要私信机器人使用#更新信息指令重新设置密码才能登录成功！</p><p>数据返回格式均为JSON，使用GET方式请求。<br> 请求格式也可使用POST，输入数据请使用JSON格式。<br> 使用POST格式请在GET参数内加上void=post。<br> 请严格参照请求格式，注意参数大小写等细节。<br> 参数返回时http状态码均为200，实际状态码在status参数里面。<br> 以下接收内容均为返回码为200的情况下才会返回的。<br> 如果返回码为非200，基本只会有message参数解释。<br></p><p>API 调用地址：<code>https://https.ghs.wiki:7002/API?</code></p><h2 id="常用输入参数" tabindex="-1"><a class="header-anchor" href="#常用输入参数" aria-hidden="true">#</a> 常用输入参数</h2><p>&quot;type&quot; 请求类型，必需<br> &quot;token&quot; 请求token，相当于密钥，绑定IP与userID 除非示例里面没有用到token，其它情况下都得用</p><h2 id="常用status返回码解析" tabindex="-1"><a class="header-anchor" href="#常用status返回码解析" aria-hidden="true">#</a> 常用status返回码解析</h2><p>&quot;200&quot; 请求成功<br> &quot;400&quot; 缺少type参数或该参数错误<br> &quot;400&quot; 参数错误或参数不足<br> &quot;401&quot; Token错误或缺失<br> &quot;403&quot; 无权限访问该内容<br> &quot;423&quot; 当前访问IP被限制为黑名单（出现多次非法请求或爆破等情况会自动拉黑）</p><div class="custom-container warning"><p class="custom-container-title">注意</p><ol><li>由于WebAPI本身特性原因，有小概率会出现请求失败的情况，推荐如果请求失败的话，有延迟的重新请求2-3次。</li><li>请勿快速请求同一个不需要经常更新的内容，会被视为DOS，我也会不定期翻看各第三方客户端的源码找此类问题</li></ol></div>',9),i=[s];function n(u,c){return e(),o("div",null,i)}const h=t(r,[["render",n],["__file","index.html.vue"]]);export{h as default};
